import React from "react";
import { fname } from "./Context";

function Comp2() {
  return (
    <>
      <fname.Consumer>
        {(name) => {
          return <h1>hey hari {name}</h1>;
        }}
      </fname.Consumer>
    </>
  );
}

export default Comp2;
